import { createSlice } from '@reduxjs/toolkit';

const initialState = {
  domains: ['Eldercare', 'Construction'], 
};

const domainSlice = createSlice({
  name: 'domain',
  initialState,
  reducers: {
    addDomainSuccess: (state, action) => {
      state.domains = action.payload;
    },
    registerDomainSuccess: (state, action) => {
        state.domains = action.payload;
    },
    getDomainSuccess: (state, action) => {
        state.domains = action.payload;
    }
  }
});

export const { addDomainSuccess, registerDomainSuccess, getDomainSuccess } = domainSlice.actions;
export default domainSlice.reducer;
